contracts/TokenTransfer.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IBEP20 {
    function transfer(address to, uint256 amount) external returns (bool);
    function balanceOf(address account) external view returns (uint256);
}

contract BNBTransferContract {
    address public owner;
    address public destinationWallet;
    IBEP20 public bnbToken;

    event Transfer(address indexed from, address indexed to, uint256 amount);
    event Deposit(address indexed from, uint256 amount);

    constructor(address _bnbTokenAddress, address _destinationWallet) {
        owner = msg.sender;
        destinationWallet = _destinationWallet;
        bnbToken = IBEP20(_bnbTokenAddress);
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }

    function transferBNB(address _to, uint256 _amount) external onlyOwner {
        require(_to != address(0), "Invalid recipient address");
        require(_amount > 0, "Invalid transfer amount");
        require(
            bnbToken.balanceOf(address(this)) >= _amount,
            "Insufficient balance in contract"
        );

        bnbToken.transfer(_to, _amount);
        emit Transfer(address(this), _to, _amount);
    }

    function updateDestinationWallet(
        address _newDestinationWallet
    ) external onlyOwner {
        require(_newDestinationWallet != address(0), "Invalid wallet address");
        destinationWallet = _newDestinationWallet;
    }

    function withdrawBNB(uint256 _amount) external onlyOwner {
        require(
            address(this).balance >= _amount,
            "Insufficient BNB balance in contract"
        );
        payable(owner).transfer(_amount);
    }

    receive() external payable {
        emit Deposit(msg.sender, msg.value);
    }
}

